function expandClass(item) {
    item.children = Functions.own(item.data.prototype)
    .map(function(e) { return item.data.prototype[e].methodName; })
    .reject(function(n) { return !n })
    .uniq()
    .sort()
    .map(function(name) {
        return this.createMethodItem(item.data.prototype[name]);
    }.bind(this));
}

