function expandNamespace(item) {
    item.children = [];
    item.children.pushAll(
        item.data.subNamespaces()
        .reject(function(ea) { return ea.isAnonymous(); })
        .sortBy(function(ns) { return ns.lastPart() })
        .map(function(ea) { return this.createNamespaceItem(ea); }.bind(this)));
    item.children.pushAll(
        item.data.classes()
        .reject(function(ea) { return ea.sourceModule != item.data })
        .reject(function(ea) { return Class.namespaceFor(Class.className(ea)) != item.data })
        .sortBy(function(ea) { return ea.name })
        .map(function(ea) { return this.createClassItem(ea); }.bind(this)));
}

