function createNamespaceItem(namespace) {
    var item = {data: namespace, codebrowser: this, children: []};
    if (namespace !== Global) item.name = "Ⓝ " + namespace.lastPart();
    Object.addScript(item, function onExpand() {
        if (this.children.length == 0)
            this.codebrowser.expandNamespace(this);
    });
    return item;
}

