function createMethodItem(method) {
    var item = {
        name: "Ⓜ " + method.methodName + (method.locallyChanged ? "*" : ""),
        data: method,
        codebrowser: this};
    Object.addScript(item, function onSelect() {
        this.codebrowser.selectMethod(this);
    });
    Object.addScript(item, function updateLocalSource(val) {
        disconnect(this.data, "localSource", this, "updateLocalSource");
        this.data = val;
        connect(this.data, "localSource", this, "updateLocalSource");
        delete this.style;
        delete this.typedSource;
        this.name = "Ⓜ " + this.data.methodName + (this.data.locallyChanged ? "*" : ""),
        signal(this, "changed");
        if (this === this.codebrowser.currentItem) {
            this.codebrowser.source.textString = this.data.toSource();
        }
    });
    Object.addScript(item, function updateTypedSource(val) {
        var bold = val == this.data.source ? 'normal' : 'bold';
        this.style = {fontWeight: bold};
        this.typedSource = val;
        signal(this, "changed");
    });
    connect(method, "localSource", item, "updateLocalSource");
    return item;
}

