function selectMethod(item) {
    this.source.reset();
    this.currentItem = item;
    if (this.owner.isWindow) {
        this.owner.setTitle(this.currentItem.data.qualifiedMethodName());
    }
    this.source.specialHighlighting = "functionDefFragment";
    if (!this.currentItem.typedSource)
        this.currentItem.typedSource = this.currentItem.data.toSource();
    this.source.textString = this.currentItem.typedSource;
    connect(this.source, "textString", this.currentItem, "updateTypedSource");
    connect(this.source, "savedTextString", this, "saveMethod");
}

